class Embedding(nn.Module):

  def __init__(self, config):
      super().__init__()
      self.embeddings = nn.Embedding(config.vocab_size, config.d_model)

  def forward(self, x):
      B,T = x.shape
      x = self.embeddings(x)   # B, T, C
      return x

