class RoPE(nn.Module):

  def __init__(self):
      super().__init__()

  def angle(self, T, x):
      B, H, T, D = x.shape
      power = torch.arange(0, D, 2, dtype=torch.float32, device=device)/D
      inv_freq = 10000 ** (-power)
      pos = torch.arange(0, T, device = device).unsqueeze(1)
      angle = pos * inv_freq
      return angle


  def forward(self, x):
      B, H, T, D = x.shape

      angles = self.angle(T, x)                     # [T, D/2]

      cos = angles.cos().unsqueeze(0).unsqueeze(0)  # [1, 1, T, D/2]

      sin = angles.sin().unsqueeze(0).unsqueeze(0)  # [1, 1, T, D/2]

      x_even = x[..., ::2]                          # [B, H, T, D/2]
      x_odd  = x[..., 1::2]

      rot_even = cos * x_even - sin * x_odd
      rot_odd  = sin * x_even + cos * x_odd

      return torch.stack([rot_even, rot_odd], dim = -1).flatten(-2)

import math
import torch
import torch.nn as nn
import torch.nn.functional as F

class GroupedMQA(nn.Module):

  def __init__(self, config):
    super().__init__()

    assert config.n_heads%config.n_groups == 0, "heads must be divisible by groups"

    self.d_head = config.d_model // config.n_heads
    self.n_groups = config.n_groups
    self.n_heads = config.n_heads

    self.q_mat = nn.Linear(config.d_model, config.d_model)
    self.k_mat = nn.Linear(config.d_model, self.n_groups * self.d_head )
    # if we have attn_head of 8 if the n_groups = 4 then it will create 4 * d_head(64) = 256 dimension vector and THEN we again reshape them and make H * d_model and then duplicate them for each group since.ss
    self.v_mat = nn.Linear(config.d_model, self.n_groups * self.d_head )
    self.o_mat = nn.Linear(config.d_model, config.d_model)
    self.RoPE = RoPE()

    self.k_cache = None
    self.v_cache = None

  def reset_kv_cache(self):
      self.k_cache = None
      self.v_cache = None

  def forward(self, x, use_kv_cache= False):

    B, T, C = x.shape             # B, T, C
    query = self.q_mat(x)         # B, T, C
    key = self.k_mat(x)           # B, T, total_groups * d_head
    value = self.v_mat(x)         # B, T, total_groups * d_head

    n_query = query.view(B, T, self.n_heads, self.d_head).transpose(1, 2)   # B, H, T, d_head
    key = key.view(B, T, self.n_groups, self.d_head).transpose(1, 2)        # B, G, T, d_head
    value = value.view(B, T, self.n_groups, self.d_head).transpose(1, 2)

    indices = torch.arange(0, self.n_heads, device=device) // (self.n_heads // self.n_groups)

    expanded_key = key[:, indices, :, :]      # B, H, T, d_head
    expanded_value = value[:, indices, :, :]  # B, H, T, d_head

    n_query = self.RoPE(n_query)
    expanded_key = self.RoPE(expanded_key)

    if use_kv_cache:

      if self.k_cache is None:
        self.k_cache = expanded_key
        self.v_cache = expanded_value

      else:
        self.k_cache = torch.cat([self.k_cache, expanded_key], dim = 2)    # B, H, T, D
        self.v_cache = torch.cat([self.v_cache, expanded_value], dim = 2)

      k_full = self.k_cache
      v_full = self.v_cache

    else:
      k_full = expanded_key
      v_full = expanded_value

    attn_score = n_query @ k_full.transpose(-2, -1) * ( 1.0 / math.sqrt(expanded_key.size(-1)))

    if use_kv_cache == False:
      mask = torch.triu(torch.ones(T, T, device=x.device), diagonal=1)
      mask = mask.masked_fill(mask == 1, float('-inf'))
      attn_score = attn_score + mask

    normalised_attn = F.softmax(attn_score, dim = -1)

    attn = normalised_attn @ v_full
    attn = attn.transpose(1, 2).contiguous().view(B, T, -1)
    attn = self.o_mat(attn)

    return attn

