def padding(tokenized_id, pad_id = 0):
  if (len(tokenized_id) < llama_config.max_len):
    return  tokenized_id + [pad_id] * (llama_config.max_len-len(tokenized_id))
  else:
    return tokenized_id[:llama_config.max_len]

def tokenizer_function(dataset):
  ids = tokenizer.encode(dataset['text'], out_type=int)
  tokenized_id = [tokenizer.bos_id()] + ids + [tokenizer.eos_id()]
  return {'input_ids': padding(tokenized_id), 'len': len(padding(tokenized_id))}

