for split, dset in tokenized.items():
    arr_len = np.sum(dset['len'], dtype=np.uint64)
    file_name = f'{split}.bin'
    arr = np.memmap(file_name, mode = 'w+', shape = (arr_len, ))

    total_batches = 256

    idx = 0
    for batch_idx in tqdm(range(total_batches), desc=f'writing {file_name}'):
        # Batch together samples for faster write
        batch = dset.shard(num_shards=total_batches, index=batch_idx, contiguous=True).with_format('numpy')
        arr_batch = np.concatenate(batch['input_ids'])
        # Write into mmap
        arr[idx : idx + len(arr_batch)] = arr_batch
        idx += len(arr_batch)
    arr.flush()

#block size = context window
def get_batch(split, block_size = 64, batch_size = 32):
    if split == 'train':
        data = np.memmap('train.bin', mode='r')
    else:
        data = np.memmap('validation.bin', mode='r')

    ix = torch.randint(len(data) - block_size, (batch_size,))
    x = torch.stack([torch.from_numpy((data[i:i+block_size]).astype(np.int64)) for i in ix])
    y = torch.stack([torch.from_numpy((data[i+1:i+1+block_size]).astype(np.int64)) for i in ix])
    if device_type == 'cuda':
        # pin arrays x,y, which allows us to move them to GPU asynchronously (non_blocking=True)
        x, y = x.pin_memory().to(device, non_blocking=True), y.pin_memory().to(device, non_blocking=True)
    else:
        x, y = x.to(device), y.to(device)
    return x, y

