"""**WEIGHTS INITIALIZATION**"""

def init_weights(module):
    if isinstance(module, nn.Linear):
        nn.init.xavier_uniform_(module.weight)
        if module.bias is not None:
            nn.init.zeros_(module.bias)

    elif isinstance(module, nn.Embedding):
        nn.init.normal_(module.weight, mean=0.0, std=0.02)

model = model.apply(init_weights)

def estimate_loss(model, inference_max_itrs = 5):

  losses = []
  model.eval()

  for split in ["train"]:
    for k in range(inference_max_itrs):
      X, y = get_batch(split)
      X, y = X.to(device), y.to(device)
      logits, loss = model(X, y)
      losses.append(loss.item())

    model.train()
    avg_loss = sum(losses)/len(losses)
    return avg_loss

import torch
from torch.optim.lr_scheduler import LinearLR, CosineAnnealingLR, SequentialLR
from torch.cuda.amp import GradScaler, autocast

# --- Optimizer with weight decay ---
optimizer = torch.optim.AdamW(
    model.parameters(),
    lr=training_config.lr,
    betas=(0.9, 0.98),
    weight_decay=0.01,
    eps=1e-9
)

# --- Learning rate scheduler: warmup + cosine decay ---
warmup_steps = 1000
max_iters = training_configs.max_iterations
min_lr = 1e-5

scheduler_warmup = LinearLR(optimizer, start_factor=0.1, total_iters=warmup_steps)
scheduler_decay = CosineAnnealingLR(optimizer, T_max=max_iters-warmup_steps, eta_min=min_lr)
scheduler = SequentialLR(
    optimizer,
    schedulers=[scheduler_warmup, scheduler_decay],
    milestones=[warmup_steps]
)

# --- Mixed precision ---
scaler = GradScaler(enabled=torch.cuda.is_available())

training_losses_ = []
steps = []
epoch_step = 500

print(f"{'='*15} TRAINING LOSS INFO {'='*15}")
for epoch in range(training_configs.max_iterations):
    model.train()
    X, y = get_batch("train")
    X, y = X.to(device), y.to(device)

    optimizer.zero_grad()

    # Use autocast for mixed precision
    with torch.amp.autocast('cuda', dtype=torch.float16 if torch.cuda.is_available() else torch.float32):
      logits, loss = model(X, y)

    # with autocast(dtype=torch.float16 if torch.cuda.is_available() else torch.float32):
    #     logits, loss = model(X, y)


    # Scale loss for mixed precision
    scaler.scale(loss).backward()

    # Gradient clipping for stability
    scaler.unscale_(optimizer)
    torch.nn.utils.clip_grad_norm_(model.parameters(), max_norm=1.0)

    scaler.step(optimizer)
    scaler.update()

    # Step scheduler
    scheduler.step()

    if epoch % epoch_step == 0:
        val_losses = estimate_loss(model)
        print(f"{'='*15} STEP: {epoch+1}/{training_configs.max_iterations} {'='*15}")
        print(f"Training Loss: {loss.item() :.4f} | Val Loss: {val_losses :.4f}")
        print(f"Current LR: {optimizer.param_groups[0]['lr']:.6f}\n")
        training_losses_.append(loss.item())
        steps.append(epoch+1)


print(f"{'='*42}")
print("\nTRAINING SUMMARY")
print(f"{'-'*len('TRAINING SUMMARY')}")

dropped_percentage = (training_losses_[0] - training_losses_[-1]) / training_losses_[0] * 100
